import React, { useState } from 'react'
const Blog = ({blog}) => {
  const [fullInfo, setFullInfo] = useState(false)

  return(
    !fullInfo && (
      <>
        <div>
          {JSON.stringify(blog)}
          {blog.title} {blog.author}
        </div>  
        <button onClick={() => setFullInfo(true)}></button>
      </>
    )
  )
}

export default Blog
